import React from 'react';
import {Box, ThemeProvider, Typography} from "@mui/material";
import theme from "./theme";
import NavBar from "./components/NavBar";

function App() {
    return (
        <ThemeProvider theme={theme}>
            <Box sx={{minHeight:"2000px"}}>
                <NavBar/>
            </Box>

        </ThemeProvider>
    );
}

export default App;
